import * as React from "react";
import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
import axios from "axios";

//
// GraphQL 
//

const GET_COMPANY_BY_ID = gql`
  query getCompanyById($CompanyId: ID!, $PopulateInput:PopulateInput!) {
    getCompanyById(CompanyId:$CompanyId, PopulateInput:$PopulateInput) {
      _id
      name
      url
      language
      signupMode
      avatar
      _owner {
        _id
      }
      inviteEmails {
        _id
        email
        accepted
      }
    }
  }
`;
const UPDATE_COMPANY_BY_ID = gql`
  mutation updateCompanyById($CompanyId: ID!, $CompanyInput: CompanyInput!) {
    updateCompanyById(CompanyId:$CompanyId, CompanyInput:$CompanyInput)
  }
`;
const S3_GENERATE_URL = gql`
  mutation s3GenerateUrl($Key: String, $ContentType: String) {
    s3GenerateUrl(Key:$Key, ContentType:$ContentType) {
      url
      name
      fileType
    }
  }
`;

// Style
import './GutterCompanySettings.styl'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faArrowRight, faArrowDown, faArrowUp
} from '@fortawesome/free-solid-svg-icons'

//
// Types
//

type GutterCompanySettingsProps = {
  toggleGutter
  toggleMenu
  toggleGutterLoader
}

//
// Function
//

const GutterCompanySettings: React.FunctionComponent<GutterCompanySettingsProps> = (props:any) => {
  // Set States
  const [companySettings, setCompanySettings] = React.useState(null);
  const [uploadFile, setUploadFile] = React.useState(null);
  const [getToggleLanguages, setToggleLanguages] = React.useState(false);
  const [languages, setLanguages]= React.useState([
    { label:'English (GB)', code:'en-GB' },
    { label:'English (US)', code:'en-US' },
  ])
  // GraphQL - Q's
  const [ callGetCompanyById, { loading, data, error }] = useLazyQuery(GET_COMPANY_BY_ID, {
    fetchPolicy: "no-cache"
  });
  // GraphQL - M's
  const [ updateCompany, { loading:companyUpateLoading, error:companyUpateError }] = useMutation(UPDATE_COMPANY_BY_ID);
  const [ s3GenerateUrl, { loading:s3GenerateUrlLoading, error:s3GenerateUrlError }] = useMutation(S3_GENERATE_URL);

  //
  // Check & Set Data
  //

  // React.useEffect(() => { },[data, setCompanySettings, companySettings]);
  if(!data && !loading && !error) {
    callGetCompanyById({
      variables:{
        "CompanyId": "5ddd3993dae01149faf416ff",
        "PopulateInput": {
          "key": "_owner",
          "skip": 0,
          "limit": 1
        }
      }
    });
  } else if(data && !loading && !error) {
    if(!companySettings) {
      setCompanySettings(data.getCompanyById);
    }
  }

  //
  // Set Data
  //

  const setData = async (key, value) => {
    if(key === 'language') {
      setToggleLanguages(false);
    }
    setCompanySettings({ ...companySettings, [key]:value });
  }

  //
  // OnChange
  //

  const onChange = (event) => {
    let newData = {...companySettings}; 
    newData[event.target.name] = event.target.value; 
    setCompanySettings(newData);
  }

  // 
  // Get Image
  //

  const getImage = (e) => {
    const files = e.target.files;
    if (files && files.length > 0) {
      const file = files[0];
      setUploadFile({ file });
    }
  };

  //
  // Upload Avatar
  //

  const uploadAvatar = async (e) => {
    event.preventDefault();
    const files = e.target.files;
    if (files && files.length > 0) {
      const file = files[0];   
      try {
        props.toggleGutterLoader(true,'loading','Uploading...','Please wait');                          
        const ext = file.name.slice((file.name.lastIndexOf(".") - 1 >>> 0) + 2);
          const name = Math.floor(Date.now() / 1000);
          const res = await s3GenerateUrl({
              variables: {
                  Key: name+'.'+ext,
                  ContentType: file.type
              }
          });       
          if(res.data.s3GenerateUrl) {     
            props.toggleGutterLoader(true,'loading','Still Uploading...','We wont be long');                          
            const aws = await axios.put(res.data.s3GenerateUrl.url, file, {
                headers: { 'Content-Type':res.data.s3GenerateUrl.fileType, 'x-amz-acl': 'public-read' }
            } )
            if(await aws) {
              if(aws.status === 200) {
                  const res = await updateCompany({
                      variables: {
                          CompanyId:companySettings._id,
                          CompanyInput: { avatar:name+'.'+ext }
                      }
                  });
                  if(await res.data.updateCompanyById) {
                    // Set Company
                    setCompanySettings({...companySettings, ['avatar']:name+'.'+ext});
                    // Reset
                    props.toggleGutterLoader(true,'success','Good Stuff','Company Settings Saved');
                    const timer = setTimeout(() => {
                      props.toggleGutterLoader(false,'success','Good Stuff','Company Settings Saved');
                    }, 4000);
                    return () => clearTimeout(timer);
                  } 
              } else {
                // Reset
                props.toggleGutterLoader(true,'error','Oh Shucks','Please try again');
                const timer = setTimeout(() => {
                  props.toggleGutterLoader(false,'error','Oh Shucks','Please try again');
                }, 4000);
                return () => clearTimeout(timer);
              }                 
            }
          }
      } catch(err) {
        props.toggleGutterLoader(true, 'error', 'Error', err);
        const timer = setTimeout(() => {
          props.toggleGutterLoader(false,'error', 'Error', err);
        }, 4000);
        return () => clearTimeout(timer);
      }
    }
  }

  //
  // Toggle Upload Avatar
  //

  const toggleUploadAvatar = async () => {
    document.getElementById('upload-company-avatar-image').click();
  }

  //
  // Submit Company Update
  //

  const submitCompanyUpdate = async () => {
    event.preventDefault();
    props.toggleGutterLoader(true,'loading','Saving...','Please wait');
    try {
        const res = await updateCompany({
            variables: {
              CompanyId:companySettings._id,
              CompanyInput: {
                "name":companySettings.name,
                "url":companySettings.url,
                "signupMode":companySettings.signupMode,
                "language":companySettings.language
              }
            }
        });
        if(await res.data.updateCompanyById) {
          props.toggleGutterLoader(true,'success','Good Stuff','Settings Saved');
          const timer = setTimeout(() => {
              props.toggleGutterLoader(false,'success','Good Stuff','Settings Saved');
              props.toggleGutter('','one-active');
          }, 4000);
          return () => clearTimeout(timer);
        }
    } catch(err) {
      props.toggleGutterLoader(true, 'error', 'Error', err);
      const timer = setTimeout(() => {
        props.toggleGutterLoader(false, 'error', 'Error', err);
        props.toggleGutter('','one-active');
      }, 4000);
      return () => clearTimeout(timer);
    }
  }

  //
  // Return
  //

  return (
    <>
      <div className="gutter-company-settings">
        <div className="settings-header">
            <h1>Company Settings</h1>
            <div className="header-back-button" onClick={(event) => props.toggleGutter('','one-active')}><FontAwesomeIcon icon={faArrowRight}/></div>
        </div>
        {companySettings && 
          <>
            <input style={{display:'none'}}
                id='upload-company-avatar-image'
                type='file'
                accept='image/*'
                onChange={uploadAvatar}
            />
            <div className="settings-avatar" onClick={toggleUploadAvatar}>
              <div className="avatar-image" style={{'backgroundImage':`url(https://seedeck-user-uploads.s3.eu-west-2.amazonaws.com/${companySettings.avatar})`}}>{companySettings.avatar === '' && companySettings.name[0]}</div>                            
              <div className="avatar-title">Upload Avatar</div>
              <div className="avatar-label">(Jpg, Png, 4mb Max)</div>
            </div>
          </>
        }
        {companySettings && 
          <form onSubmit={submitCompanyUpdate}>
            <div className="form-label">Company Name</div>
            <input type="text" onChange={(event) => onChange(event)}  name="name" placeholder="Name" value={companySettings.name || ""}/>
            <div className="form-label">Company URL</div>
            <input type="text" onChange={(event) => onChange(event)}  name="url" placeholder="Url" value={companySettings.url || ""}/>
            <div className="form-footnote">Let people know what you do or what your role is.</div>
            <div className="form-label">Invite Status</div>
            <div className="form-select">
              <div className={`select-button ${companySettings.signupMode == 'invite' ? 'select-button-active' : ''}`}  onClick={(event) => setData('signupMode','invite') }>Link</div>
              <div className={`select-button ${companySettings.signupMode == 'email' ? 'select-button-active' : ''}`}  onClick={(event) => setData('signupMode','email') }>Email</div>
            </div>
            <div className="form-footnote">Let people know what you do or what your role is.</div>
            <div className="form-label">Language</div>
            <div className="form-drop-down">
              <div className="down-button" onClick= {(event) => getToggleLanguages ? setToggleLanguages(false) : setToggleLanguages(true)}>           
                {languages.map((value, index) => {
                  return (
                    companySettings.language === value.code && <div key={index}>{value.label}</div>
                  )
                })}
                { getToggleLanguages && <div className="button-icon"><FontAwesomeIcon icon={faArrowUp}/></div>}
                { !getToggleLanguages && <div className="button-icon"><FontAwesomeIcon icon={faArrowDown}/></div>}
              </div>
              { getToggleLanguages && <div className="down-list">                
                {languages.map((value, index) => {
                  return (
                    <div className={ index+1 === languages.length ? 'list-item list-item-last':'list-item' } key={index}  onClick={(event) => setData('language',value.code) }>
                      {value.label}
                    </div>
                  )
                })}
              </div> }
            </div>
            <button>Update Company</button>
          </form>
        }
      </div>
    </>
  );
};

export default GutterCompanySettings
